svg.script:
function muestraToolTip (evt,info,info1,info2,Xbuena,Ybuena){
	var target = get_target(evt);
	var svgdoc = target.getOwnerDocument();
	var svgdocElement = svgdoc.getDocumentElement();
	var scale = svgdocElement.getCurrentScale();
	var translateX = svgdocElement.getCurrentTranslate().getX();
	var translateY = svgdocElement.getCurrentTranslate().getY();
	var pixel = 1 / scale;
	var offsetX = parseFloat(0) - translateX * pixel;
	var offsetY = parseFloat(0) - translateY * pixel;
	var tooltip= 'Tooltip'
	var tooltipEML= 'TooltipEML'
	var tooltipP= 'TooltipP'
	var tooltiprect= 'TooltipRect'

	Ybuena-=70*pixel;

	var svgobj = svgdoc.getElementById (tooltip);
	svgobj.setAttribute ('x', Math.round(Xbuena));					
	svgobj.setAttribute ('y', (Math.round(Ybuena)));
	var svgstyle = svgobj.getStyle();
	svgstyle.setProperty ('visibility', 'visible');
	svgstyle.setProperty('font-size', 12*pixel);
	svgobj1 = svgobj.getFirstChild()
	svgobj1.setData(info);
	var txtlen1=svgobj.getComputedTextLength();


	var svgobj = svgdoc.getElementById (tooltipP);
	svgobj.setAttribute ('x', Math.round(Xbuena));
	svgobj.setAttribute ('y', (Math.round(Ybuena+24*pixel)));
	var svgstyle = svgobj.getStyle();
	svgstyle.setProperty ('visibility', 'visible');
	svgstyle.setProperty('font-size', 12*pixel);
	svgobj1 = svgobj.getFirstChild()					
	svgobj1.setData(info1);
	var txtlen2=svgobj.getComputedTextLength();


	var svgobj = svgdoc.getElementById (tooltipEML);
	svgobj.setAttribute ('x', Math.round(Xbuena));
	svgobj.setAttribute ('y', (Math.round(Ybuena+36*pixel)));
	var svgstyle = svgobj.getStyle();
	svgstyle.setProperty ('visibility', 'visible');
	svgstyle.setProperty('font-size', 12*pixel);
	svgobj1 = svgobj.getFirstChild()					
	svgobj1.setData(info2);
	var txtlen3=svgobj.getComputedTextLength();


	var txtlen12=(txtlen1>txtlen2)?txtlen1:txtlen2;
	var txtlen=(txtlen12>txtlen3)?txtlen12:txtlen3;

	txtlen+=20*pixel;	

	var svgobj = svgdoc.getElementById (tooltiprect);
	svgobj.setAttribute ('x', (Math.round(Xbuena-txtlen/2)));
	svgobj.setAttribute ('y', (Math.round(Ybuena-18*pixel)));
	svgobj.setAttribute ('width', txtlen);
	svgobj.setAttribute ('height',60*pixel);
	svgobj.setAttribute ('rx', 5*pixel);
	svgobj.setAttribute ('ry', 5*pixel);

	var svgstyle = svgobj.getStyle();
	svgstyle.setProperty ('visibility', 'visible');
	svgstyle.setProperty ('stroke-width', pixel);
}

function ocultaToolTip(evt){
	var target = get_target(evt);
	var svgdoc = target.getOwnerDocument();
	var tooltip= 'Tooltip'
	var tooltipEML= 'TooltipEML'
	var tooltipP= 'TooltipP'
	var tooltiprect= 'TooltipRect'

	var svgobj = svgdoc.getElementById (tooltip);
	var svgstyle = svgobj.getStyle();
	svgstyle.setProperty ('visibility', 'hidden');

	var svgobj = svgdoc.getElementById (tooltipEML);
	var svgstyle = svgobj.getStyle();
	svgstyle.setProperty ('visibility', 'hidden');

	var svgobj = svgdoc.getElementById (tooltipP);
	var svgstyle = svgobj.getStyle();
	svgstyle.setProperty ('visibility', 'hidden');

	var svgobj = svgdoc.getElementById (tooltiprect);
	var svgstyle = svgobj.getStyle();
	svgstyle.setProperty ('visibility', 'hidden');
}

function get_target (evt){
	var target = evt.getTarget();
	while (target && !target.getAttribute('id'))
			target = target.getParentNode();
	return target;
}

function abrir_url(grupo) {					 
	//var cad='http://sic.conaculta.gob.mx/grupo_etnico/grupo2ficha.php?grupo_Id='+grupo;
	var cad='http://sic.conaculta.gob.mx/ficha.php?table=grupo_etnico&count=&table_id='+grupo;      					
	var miV=open(cad,'ventanasic','scrollbars=yes,menubar=yes,toolbar=yes,location=yes,resizable=yes,status=yes,width=800,height=800');
	miV.focus();
}
